apping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":2300,"length":2,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":2302,"length":11,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"}]}},{"compositeVideoPrimaryInfoRenderer":{}},{"merchandiseShelfRenderer":{"title":"Shop the Peter Gabriel store","items":[{"merchandiseItemRenderer":{"title":"i/o Box Set","description":"Peter Gabriel – i/o – Box Set This Box-Set comes in a foil blocked, clamshell box with obi-band, containing both Bright-Side and Dark-Side stereo mixes of the album across 4 pieces of black vinyl cut at 33rpm. The same mixes also appear across two CDs and the In-Side Mixes on a Blu-ray in Dolby Atmos. The Blu-ray also contains 24/96 versions of the Bright-Side and Dark-Side stereo mixes.Also included is a casebound book with expanded liner notes and a poster. i/o is 12 tracks of grace, gravity and great beauty that provide welcome confirmation of not only Peter’s ongoing ability to write stop-you-in-your-tracks songs but also of that thrilling voice, still perfectly, delightfully intact. Throughout the album the intelligent and thoughtful – often thought-provoking – songs tackle life and the universe. Our connection to the world around us – ‘I’m just a part of everything’ Peter sings on title track i/o – is a recurring motif, but so too the passing of time, mortality and grief, alongside such themes as injustice, surveillance and the roots of terrorism. But this is not a solemn record. While reflective, the mood is never despondent; i/o is musically adventurous, often joyous and ultimately full of hope, topped off as it is, by the rousingly optimistic closing song, Live and Let Live. ‘After a years-worth of full moon releases, I’m very happy to see all these new songs back together on the good ship i/o and ready for their journey out into the world.’ – Peter Gabriel Recorded mostly at Real World Studios and Peter’s home studio, the lengthy gestation of i/o means it has a sizeable cast list. Peter has kept his trusty inner circle of musicians close to hand, which means guitarist David Rhodes, bassist Tony Levin and drummer Manu Katché are sterling presences throughout. Several songs bear the fingerprints of long-time associate Brian Eno, whilst there are notable contributions from Richard Russell, pianist Tom Cawley, trumpeters Josh Shpak and Paolo Fresu, cellist Linnea Olsson and keyboard player Don E. Peter’s daughter Melanie contributes warm backing vocals, as does Ríoghnach Connolly of The Breath, while Real World regulars Richard Chappell, Oli Jacobs, Katie May and Richard Evans collectively provide programming and play various instruments. Soweto Gospel Choir and Swedish all-male choir Oprhei Drängar lend their magnificent harmonies to a selection of tracks, and the mass strings of the New Blood Orchestra, led by John Metcalfe, both soothe and soar. Renowned for being a boundary-pushing artist, i/o is not simply a collection of a dozen songs. All 12 tracks are subject to two stereo mixes: the Bright-Side Mix, handled by Mark ‘Spike’ Stent, and the Dark-Side Mix, as reshaped by Tchad Blake. “We have two of the greatest mixers in the world in Tchad and Spike and they definitely bring different characters to the songs. Tchad is very much a sculptor building a journey with sound and drama, Spike loves sound and assembling these pictures, so he’s more of a painter.” A third version – the In-Side Mix, in Dolby Atmos, comes courtesy of Hans-Martin Buff “doing a wonderful job generating these much more three-dimensional mixes” and is included in a three-disc set, including Blu-ray. Continuing the idea developed for Peter’s US and UP albums, he has again invited a range of visual artists to contribute a piece of art to accompany the music and each of i/o’s 12 songs were handed to a world-renowned artist to create an accompanying work, whether paint, photography, sculpture or even Plasticine. The dozen artist h the In-Side Mix (Dolby Atmos). The Blu-ray also contains the 24/96 hi-res stereo Bright-Side and Dark-Side mixes.The three discs come in an 8panel digi-pack, with obi-strip and 32page booklet. i/o is 12 tracks of grace, gravity and great beauty that provide welcome confirmation of not only Peter’s ongoing ability to write stop-you-in-your-tracks songs but also of that thrilling voice, still perfectly, delightfully intact. Throughout the album the intelligent and thoughtful – often thought-provoking – songs tackle life and the universe. Our connection to the world around us – ‘I’m just a part of everything’ Peter sings on title track i/o – is a recurring motif, but so too the passing of time, mortality and grief, alongside such themes as injustice, surveillance and the roots of terrorism. But this is not a solemn record. While reflective, the mood is never despondent; i/o is musically adventurous, often joyous and ultimately full of hope, topped off as it is, by the rousingly optimistic closing song, Live and Let Live. ‘After a years-worth of full moon releases, I’m very happy to see all these new songs back together on the good ship i/o and ready for their journey out into the world.’ – Peter Gabriel Recorded mostly at Real World Studios and Peter’s home studio, the lengthy gestation of i/o means it has a sizeable cast list. Peter has kept his trusty inner circle of musicians close to hand, which means guitarist David Rhodes, bassist Tony Levin and drummer Manu Katché are sterling presences throughout. Several songs bear the fingerprints of long-time associate Brian Eno, whilst there are notable contributions from Richard Russell, pianist Tom Cawley, trumpeters Josh Shpak and Paolo Fresu, cellist Linnea Olsson and keyboard player Don E. Peter’s daughter Melanie contributes warm backing vocals, as does Ríoghnach Connolly of The Breath, while Real World regulars Richard Chappell, Oli Jacobs, Katie May and Richard Evans collectively provide programming and play various instruments. Soweto Gospel Choir and Swedish all-male choir Oprhei Drängar lend their magnificent harmonies to a selection of tracks, and the mass strings of the New Blood Orchestra, led by John Metcalfe, both soothe and soar. Renowned for being a boundary-pushing artist, i/o is not simply a collection of a dozen songs. All 12 tracks are subject to two stereo mixes: the Bright-Side Mix, handled by Mark ‘Spike’ Stent, and the Dark-Side Mix, as reshaped by Tchad Blake. “We have two of the greatest mixers in the world in Tchad and Spike and they definitely bring different characters to the songs. Tchad is very much a sculptor building a journey with sound and drama, Spike loves sound and assembling these pictures, so he’s more of a painter.” Continuing the idea developed for Peter’s US and UP albums, he has again invited a range of visual artists to contribute a piece of art to accompany the music and each of i/o’s 12 songs were handed to a world-renowned artist to create an accompanying work, whether paint, photography, sculpture or even Plasticine. The dozen artists make an exceedingly impressive team of collaborators: Ai Weiwei, Nick Cave, Olafur Eliasson, Henry Hudson, Annette Messager, Antony Micallef, David Moreno, Cornelia Parker, Megan Rooney, Tim Shaw, David Spriggs and Barthélémy Toguo. Another visual link with Peter’s past work is the cover shot. Taken by photographer Nadav Kander, it echoes with the covers of his earlier albums, always present but, with the exception of So, intriguingly obscured or manipulated. These echoes of the past might resonate, but i/o is fundamentally an album of – and for – the here and now. Many of its themes may be timeless, but they’re also warnings that we’re living on borrowed time, both as a planet and as individuals. As Peter sings on the divine So Much, “this edition is limited”. The wait has been worth every minute. i/o is another triumphant Peter Gabriel record. PGCDBR21CD1 Bright-Side","thumbnail":{"thumbnails":[{"url , bassist Tony Levin and drummer Manu Katché are sterling presences throughout. Several songs bear the fingerprints of long-time associate Brian Eno, whilst there are notable contributions from Richard Russell, pianist Tom Cawley, trumpeters Josh Shpak and Paolo Fresu, cellist Linnea Olsson and keyboard player Don E. Peter’s daughter Melanie contributes warm backing vocals, as does Ríoghnach Connolly of The Breath, while Real World regulars Richard Chappell, Oli Jacobs, Katie May and Richard Evans collectively provide programming and play various instruments. Soweto Gospel Choir and Swedish all-male choir Oprhei Drängar lend their magnificent harmonies to a selection of tracks, and the mass strings of the New Blood Orchestra, led by John Metcalfe, both soothe and soar. Renowned for being a boundary-pushing artist, i/o is not simply a collection of a dozen songs. All 12 tracks are subject to two stereo mixes: the Bright-Side Mix, handled by Mark ‘Spike’ Stent, and the Dark-Side Mix, as reshaped by Tchad Blake. “We have two of the greatest mixers in the world in Tchad and Spike and they definitely bring different characters to the songs. Tchad is very much a sculptor building a journey with sound and drama, Spike loves sound and assembling these pictures, so he’s more of a painter.” Continuing the idea developed for Peter’s US and UP albums, he has again invited a range of visual artists to contribute a piece of art to accompany the music and each of i/o’s 12 songs were handed to a world-renowned artist to create an accompanying work, whether paint, photography, sculpture or even Plasticine. The dozen artists make an exceedingly impressive team of collaborators: Ai Weiwei, Nick Cave, Olafur Eliasson, Henry Hudson, Annette Messager, Antony Micallef, David Moreno, Cornelia Parker, Megan Rooney, Tim Shaw, David Spriggs and Barthélémy Toguo. Another visual link with Peter’s past work is the cover shot. Taken by photographer Nadav Kander, it echoes with the covers of his earlier albums, always present but, with the exception of So, intriguingly obscured or manipulated. These echoes of the past might resonate, but i/o is fundamentally an album of – and for – the here and now. Many of its themes may be timeless, but they’re also warnings that we’re living on borrowed time, both as a planet and as individuals. As Peter sings on the divine So Much, “this edition is limited”. The wait has been worth every minute. i/o is another triumphant Peter Gabriel record. PGLPX21LP1SIDE A1. Panopticom2. Playing for Time3. The CourtSIDE B4. Four Kinds of Horses5. i/o6. Love Can HealLP2SIDE C7. Road to Joy8. So Much9. Olive TreeSIDE D10. This Is Home11. And Still12. Live an","thumbnail":{"thumbnails":[{"url":"https://encrypted-tbn0.gstatic.com/shopping?q=tbn:ANd9GcTy8_0nNF8EYiWqFfkZdDuPKbpmZJhh2-_OMfZuvP2OManelplyzaapdl_bToD6WoTmz2gGmuVw","width":128,"height":128},{"url":"https://encrypted-tbn0.gstatic.com/shopping?q=tbn:ANd9GcTDizo_pB1FKz_ofkBCC0aBT2_Fq6GsfFgBspUFS7jifU99qHIP3Cvxt8-wQD87zWitQM2VUvg3","width":256,"height":256},{"url":"https://encrypted-tbn0.gstatic.com/shopping?q=tbn:ANd9GcRh2P5tdArUc8LOXAwgRFXr4jZBVny8TIeIDPbui_KCFE4h1CAQCAcZcoPU5f4iRrXZf-FqyaS8","width":512,"height":512}]},"price":"$53.74","vendorName":"Real World Store","trackingParams":"CKsDEJP0ARgDIhMIw53XssyAkAMVEABoCB2ZfgNQ","buttonText":"Shop","buttonCommand":{"clickTrackingParams":"CKsDEJP0ARgDIhMIw53XssyAkAMVEABoCB2ZfgNQygEEv1zFkw==","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CKsDEJP0ARgDIhMIw53XssyAkAMVEABoCB2ZfgNQygEEv1zFkw==","commandMetadata":{"webCommandMetadata":{"sendPost":true,"apiUrl":"/youtubei/v1/feedback"}},"feedbackEndpoint":{"feedbackToken":"AB9zfpJuTpNz9jSlUWiqN5lZ15fCVeyqZevQBFRyxbZR6qOk1uUq131bTt45ATH6aKvUHoEa8CCLW5FwbrLQR6C84etJ7LT5bs6GHa0UjeVnGbDA7RFYF0NGBMwbg1ADZ0lUrw86Ld9HlCs02HE-zzGxdJ-TBqVpFY1uiIybWeE2t1O97jfEg1fUJkNm_-tA-6Hdl7TAfsNp10Dk8Ls7tXG-Nmd9Abk6FAXkaiXgeK32b4DcbNWQOddmcHSoJeNsSYp0ksQetBI0oxO841n1peqBXbraU1UEdN_OR4tKiR_xGY6i2j5 l concert, now fully restored and pieced together from over 150 reels of original 35mm negatives and remixed in 5.1, this concert is made available for the first time on DVD. - So: Classic Album documentary. From the acclaimed \u0026 award winning Classic Album series, this film tells the story behind the making of Peter Gabriel’s 1986 album So and features contributions from many of those involved in the album and videos, with interviews with Peter, co-producer Daniel Lanois and many more. - An 180grm So LP – mastered at half speed to maximize the audio quality \u0026 the track listing, unlike the original, is that favoured by the artist. - Double A side 12” vinyl collectible containing two previously unreleased tracks Courage and Sagrada plus Don’t Give Up (alternative version piano and bvox mix) - A 60 page case bound book including an introduction and So DNA summary by Peter Gabriel, new liner notes and an extensive collection of rare and never before seen photographs.","thumbnail":{"thumbnails":[{"url":"https://encrypted-tbn1.gstatic.com/shopping?q=tbn:ANd9GcQaZuDmjpmlsx8s_j0Gos7Vew9Z9-X0o2qrK6NeCPaxv5cGXOwpodGQ0FFZ4uOG7sji-tGC-LE","width":128,"height":127},{"url":"https://encrypted-tbn1.gstatic.com/shopping?q=tbn:ANd9GcQ9RH98fiFhyst6newaMm9fMxIeTvS3CFhVc6o-d74NlyuEUOVjDEHPnhBXWdeYL3QB39whhj_Z","width":256,"height":252},{"url":"https://encrypted-tbn1.gstatic.com/shopping?q=tbn:ANd9GcS0CM6NFNujMo2XFp8lQHcqhChvBTdklUZfINLbH4ZefTuesiI9rFvl14nHkw_CCMHJhjIF2aGw","width":512,"height":504}]},"price":"$67.17","vendorName":"Real World Store","trackingParams":"CKgDEJP0ARgGIhMIw53XssyAkAMVEABoCB2ZfgNQ","buttonText":"Shop","buttonCommand":{"clickTrackingParams":"CKgDEJP0ARgGIhMIw53XssyAkAMVEABoCB2ZfgNQygEEv1zFkw==","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CKgDEJP0ARgGIhMIw53XssyAkAMVEABoCB2ZfgNQygEEv1zFkw==","commandMetadata":{"webCommandMetadata":{"sendPost":true,"apiUrl":"/youtubei/v1/feedback"}},"feedbackEndpoint":{"feedbackToken":"AB9zfpKbnvL8K0rvM
